package n16.hb_n16.controller;

import n16.hb_n16.entity.SaleOrder;
import n16.hb_n16.entity.SaleOrderDetail;
import n16.hb_n16.entity.User;
import n16.hb_n16.services.SaleOrderDetailService;
import n16.hb_n16.services.SaleOrderService;
import n16.hb_n16.services.UserService;
import org.springframework.stereotype.Controller;
import org.springframework.ui.Model;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.PathVariable;
import org.springframework.web.bind.annotation.RequestMapping;

import java.util.ArrayList;
import java.util.List;

@Controller
@RequestMapping("/pa/orders")
public class PAOrdersController {
    private UserService userService;
    private SaleOrderService saleOrderService;
    private SaleOrderDetailService saleOrderDetailService;

    public PAOrdersController(UserService userService, SaleOrderService saleOrderService, SaleOrderDetailService saleOrderDetailService) {
        this.userService = userService;
        this.saleOrderService = saleOrderService;
        this.saleOrderDetailService = saleOrderDetailService;
    }

    public String showPAProcessingOrdersPage(Model model) {
        User currentUser = UserSession.getCurrentUser(userService);
        UserSession.getLoggedUserInfo(userService, model);

        String tmpAvatar = null;
        if (currentUser.getAvatar() != null) {
            model.addAttribute("userAvatar", "data:image/png;base64," + currentUser.getAvatar());
        } else {
            tmpAvatar = "data:image/png;base64,";

            model.addAttribute("userAvatar", tmpAvatar);
        }

        model.addAttribute("currentUser", currentUser);

        List<SaleOrder> saleOrderList = saleOrderService.getSaleOrdersByCustomerID(currentUser.getCustomerId());
        List<SaleOrder> saleOrderStatus1 = new ArrayList<>();
        for (SaleOrder s : saleOrderList) {
            if (s.getStatus() == 1) {
                saleOrderStatus1.add(s);
            }
        }
        model.addAttribute("orderList", saleOrderStatus1);
        model.addAttribute("pageTitle", "Đơn hàng đang xử lí");

        return "/view_customer/pa_processing_orders";
    }

    @RequestMapping("/shippingOrders")
    public String showPAShippingOrdersPage(Model model) {
        User currentUser = UserSession.getCurrentUser(userService);

        UserSession.getLoggedUserInfo(userService, model);

        if (currentUser.getAvatar() != null) {
            model.addAttribute("userAvatar", "data:image/png;base64," + currentUser.getAvatar());
        } else {
            String tmpAvatar = "data:image/png;base64,";

            model.addAttribute("userAvatar", tmpAvatar);
        }

        model.addAttribute("currentUser", currentUser);

        List<SaleOrder> saleOrderList = saleOrderService.getSaleOrdersByCustomerID(currentUser.getCustomerId());
        List<SaleOrder> saleOrderStatus2 = new ArrayList<SaleOrder>();
        for (SaleOrder s : saleOrderList) {
            if(s.getStatus() == 2) saleOrderStatus2.add(s);
        }
        model.addAttribute("orderList", saleOrderStatus2);

        model.addAttribute("pageTitle", "Đơn hàng đang vận chuyển");
        return "/view_customer/pa_shipping_orders";
    }

    @GetMapping("/shippedOrders")
    public String showPAShippedOrdersPage(Model model){
        User currentUser = UserSession.getCurrentUser(userService);

        UserSession.getLoggedUserInfo(userService, model);

        if (currentUser.getAvatar() != null) {
            model.addAttribute("userAvatar", "data:image/png;base64," + currentUser.getAvatar());
        } else {
            String tmpAvatar = "data:image/png;base64,";

            model.addAttribute("userAvatar", tmpAvatar);
        }

        model.addAttribute("currentUser", currentUser);

        List<SaleOrder> saleOrderList = saleOrderService.getSaleOrdersByCustomerID(currentUser.getCustomerId());
        List<SaleOrder> saleOrderStatus4 = new ArrayList<SaleOrder>();
        for (SaleOrder s : saleOrderList) {
            if(s.getStatus() == 4) saleOrderStatus4.add(s);
        }
        model.addAttribute("orderList", saleOrderStatus4);

        model.addAttribute("pageTitle", "Đơn hàng đã giao xong");
        return "/view_customer/pa_shipped_orders";
    }

    @GetMapping("/orderDetails/{saleOrderId}")
    public String showPAOrderDetails(Model model, @PathVariable("saleOrderId") int saleOrderId) {
        User currentUser = UserSession.getCurrentUser(userService);

        UserSession.getLoggedUserInfo(userService, model);

        if (currentUser.getAvatar() != null) {
            model.addAttribute("userAvatar", "data:image/png;base64," + currentUser.getAvatar());
        } else {
            String tmpAvatar = "data:image/png;base64,";

            model.addAttribute("userAvatar", tmpAvatar);
        }

        model.addAttribute("currentUser", currentUser);

        SaleOrder saleOrder = saleOrderService.getSaleOrderBySaleOrderID(saleOrderId);

        List<SaleOrderDetail> saleOrderDetailList = saleOrderDetailService.getSaleOrderDetailsBySaleOrderID(saleOrderId);

        model.addAttribute("orderDetailNum", saleOrderDetailList.size());
        model.addAttribute("orderDetailList", saleOrderDetailList);
        model.addAttribute("saleOrder", saleOrder);
        model.addAttribute("status", saleOrder.getStatus());

        int totalQty = 0;
        for (SaleOrderDetail s : saleOrderDetailList) {
            totalQty += s.getOrderQty();
        }
        model.addAttribute("totalQty", totalQty);

        model.addAttribute("pageTitle", "Đơn hàng của bạn");
        return "view_customer/info_orderdetail";
    }

    @GetMapping("/cancelOrders/{saleOrderId}")
    public String cancelOrdersPage(Model model, @PathVariable("saleOrderId") int saleOrderId){
        User currentUser = UserSession.getCurrentUser(userService);

        UserSession.getLoggedUserInfo(userService, model);

        if (currentUser.getAvatar() != null) {
            model.addAttribute("userAvatar", "data:image/png;base64," + currentUser.getAvatar());
        } else {
            String tmpAvatar = "data:image/png;base64,";

            model.addAttribute("userAvatar", tmpAvatar);
        }

        model.addAttribute("currentUser", currentUser);

        SaleOrder saleOrder = saleOrderService.getSaleOrderBySaleOrderID(saleOrderId);
        short cancel = 3;
        saleOrder.setStatus(cancel);
        saleOrderService.addOrUpdateSaleOrder(saleOrder);

        List<SaleOrder> saleOrderList = saleOrderService.getSaleOrdersByCustomerID(currentUser.getCustomerId());
        List<SaleOrder> saleOrderStatus1 = new ArrayList<>();
        for (SaleOrder s : saleOrderList) {
            if(s.getStatus() == 1) saleOrderStatus1.add(s);
        }
        model.addAttribute("orderList", saleOrderStatus1);

        model.addAttribute("pageTitle", "Đơn hàng đang xử lí");
        return "/view_customer/pa_processing_orders";
    }
}
